//SPDX-License-Identifier: MIT
pragma solidity >= 0.6.0 <0.8.0;

import "./Collectible.sol";

contract Broker {
    Collectible private token;

    constructor (Collectible _token) {
        token=_token;
    }

    event minedSuccessfully(address indexed user, string category, string challenge);

    /**
     * @param challenge is the challenge string, basically a random input of arbitrary length
     * @param category which category you'd like to mine, must exist in the Collectible's mapping
     * 
     * summary:
     * challenge = "apple"
     * target = "cd25"
     * returns keccak256("apple") == 0x??...??cd25 (so returns true)
     */
    function check_challenge(string memory challenge, string memory category) public view returns(uint) {
        // hash with last blockhash to avoid giving an advantage to people mining locally without pinging this contract
        bytes32 hashed_challenge = keccak256(abi.encodePacked(challenge/*,blockhash(block.number-1)*/));

        bytes memory hashed_ch_bytes = abi.encodePacked(hashed_challenge);
        bytes memory target_bytes = abi.encodePacked(token.getCategoryTarget(category)); // returns the bits associated with this category's rarity

        require(target_bytes.length <= hashed_ch_bytes.length, "Error, the target identifier is longer than the hash.");

        // the core, check every 4 bits if they're equal
        bool failed;
        for (uint256 i = 0; i < target_bytes.length; i++) {
            bytes1 hash_byte = hashed_ch_bytes[hashed_ch_bytes.length-1-i];
            bytes1 target_byte = target_bytes[target_bytes.length-1-i];

            if (hash_byte != target_byte) failed=true;
            if (failed) break;
        }
        if (failed) return 0;
        else return bytesToUInt(hashed_challenge);
    }

    function mine(string memory challenge, string memory category) public payable {
        uint id = check_challenge(challenge, category);
        require(id != 0, "Did not crack the challenge.");
        emit minedSuccessfully(msg.sender, category, challenge);
        token.mint(id, msg.sender);
    }

    /// @dev Converts a numeric string to its unsigned integer representation.
    /// @param v The string to be converted.
    function bytesToUInt(bytes32 v) pure private returns (uint ret) {
        require (v != 0x0);

        uint digit;

        for (uint i = 0; i < 32; i++) {
            digit = uint((uint(v) / (2 ** (8 * (31 - i)))) & 0xff);
            if (digit == 0) {
                break;
            }
            require(digit < 48 || digit > 57);
            ret *= 10;
            ret += (digit - 48);
        }
        return ret;
    }
}

